import React from "react";
import Ani from "./Contact";
import animedata from "./rjs";

export default function App() {
  const animeElement = animedata.map((anim) => {
    return <Ani anime={anim.anime} mc={anim.mc}></Ani>;
  });
  return (
    <div>
      <Ani></Ani>
    </div>
  );
}
